import React, { Component } from 'react';

class Sort extends Component {
    constructor(props) {
        super(props)
        this.optionValues = [
            {
                name: "All",
                value: "all"
            }, {
                name: "Veg",
                value: "veg"
            }, {
                name: "Non-veg",
                value: "non-veg"
            }
        ]
    }

    render() {
        return (
            <div className='sort'>
                <p>Sort By</p>
                <select name='sortBy' id='sortBy'>
                {
                    this.optionValues.map((option, index) => <option key={index} value={option.value}>{option.name}</option>)
                }
            </select>
            </div>
        )
    }
}

export default Sort
